export function add09(a: number, b: number): number {
  return a + b;
}

export function subtract09(a: number, b: number): number {
  return a - b;
}

export function multiply09(a: number, b: number): number {
  return a * b;
}

export function divide09(a: number, b: number): number {
  return a / b;
}
